  const urlDentist = 'https://jsonplaceholder.typicode.com/users/' + params.id
  console.log("params: " + params)

  useEffect(() => {
    axios(urlDentist)
    .then(res => console.log("Res: " + res))
  }, [])
  

  console.log("dentistState: " + dentistState)

